import React from 'react';

export default function Navigation() {
	return (
		<nav className='flex justify-between h-24 items-center font-primary bg-primary text-white'>
			<div className=''>
				<h1 className='text-2xl md:text-4xl font-bold '>BullBear</h1>
			</div>
			<div className=''>
				<ul className='flex flex-row gap-4 md:gap-8'>
					<li className=''>Market</li>
					<li className=''>Portfolio</li>
					<li className=''>Contact</li>
				</ul>
			</div>
		</nav>
	);
}
